import * as React from 'react';
import pic from '../../images/beauty-products.jpg';

const Top = () => {
    return (
        <div className="container-fluid p-0">
          <div className="row no-gutters">
            <div className="col-12 col-md-6 col-sm-12 d-flex justify-content-center align-items-center text-center bg-light-blue">
              <h1 className="p-5 p-md-4">This is a page for beauty product search</h1>
            </div> 
            <div className="col-12 col-md-6 col-sm-12 d-flex justify-content-center align-items-center">
              <img className="img-fluid" src={pic}/>
            </div>        
          </div>
        </div>
    )
}

export default Top;
